import './NavBar.css'
import { NavLink } from 'react-router-dom';
import { useEffect, useState } from 'react';

const styles = {
    container: {
        display: 'flex',
    },
    navStyle: {
        textDecoration: 'none',
        color: '#0078d7',
        fontSize: '20px',
        width: '100px',
        display: 'block',
        borderRadius: "12px",


    },
    currentPage: {
        backgroundColor: "#2da9ad",
    },
}

const NavBarStyle = ({isActive}) => {
    return{
        textDecoration: 'none',
        color: '#0078d7',
        fontSize: '20px',
        backgroundColor: isActive ? "#2da9ad": '',
        borderRadius: "12px",
        paddingTop: '10px,',
        paddingBottom: '10px',
    }
}

function NavBar() {

    return (
        <div id="nav-container">
            <nav id="navBar">
                <div style={styles.container}>
                            <NavLink to="/" style={styles.navStyle} activeStyle={styles.currentPage} >Home</NavLink>
                            <NavLink to="/projects" style={styles.navStyle} activeStyle={styles.currentPage}>Projects</NavLink>
                            <NavLink to="/app" style={styles.navStyle} activeStyle={styles.currentPage}>App</NavLink>
                            <NavLink to="/others" style={styles.navStyle} activeStyle={styles.currentPage}>Others</NavLink>
                </div>
            </nav>
        </div>
    );
}

export default NavBar;
